
if object_id('[exResultSetCapture]') is not null
	DROP PROCEDURE [dbo].[exResultSetCapture]
GO

if object_id('[ResultSetCapture]') is not null
	DROP PROCEDURE [dbo].[ResultSetCapture]
GO

if (SELECT assembly_id FROM sys.assemblies where name = 'SQLCommandExecute') is not NULL
	DROP ASSEMBLY [SQLCommandExecute]
GO

SET ANSI_NULLS OFF
SET QUOTED_IDENTIFIER OFF
GO


CREATE ASSEMBLY [SQLCommandExecute]
FROM 
WITH PERMISSION_SET = SAFE

GO

ALTER ASSEMBLY [SQLCommandExecute]
ADD FILE FROM 
AS N'SQLCommandExecute.pdb'

GO


CREATE PROCEDURE [dbo].[ResultSetCapture]
	@Command [nvarchar](max),
	@Debug [smallint],
	@rsTable1 [nvarchar](max),
	@rsColumnList1 [nvarchar](max),
	@rsTable2 [nvarchar](max),
	@rsColumnList2 [nvarchar](max)
WITH EXECUTE AS CALLER
AS
EXTERNAL NAME [SQLCommandExecute].[StoredProcedures].[ResultSetCapture]
GO

-- =============================================
-- Can't use defaults in SQLCLR
-- so we'll abstract through a functions
-- and apply defaults there
-- =============================================
CREATE PROCEDURE [dbo].[exResultSetCapture]
(
    @Command varchar(max), @Debug int = 0 ,
    @rsTable1 varchar(max) = '', @rsColumnList1 varchar(max) = '*',
    @rsTable2 varchar(max) = '', @rsColumnList2 varchar(max) = '*'

)
AS
BEGIN
	
    EXEC dbo.ResultSetCapture 
		@Command=@Command, @Debug = @Debug,
		@rsTable1=@rsTable1, @rsColumnList1=@rsColumnList1, 
		@rsTable2=@rsTable2, @rsColumnList2=@rsColumnList2
		
	RETURN 0

END

GO

